var create_plugin = (function() {
	var m_plugin_host = null;
	var m_is_init = false;

	var m_status = [];

	var SYSTEM_DOMAIN = UPSTREAM_DOMAIN + UPSTREAM_DOMAIN;
	var SERVICE_DOMAIN = UPSTREAM_DOMAIN + "service.";
	var MOVE_TIMEOUT = 60 * 1000;// 1min

	var FORWARD_ICON = "data:image/png;base64,";
	var FORWARD_PUSHED_ICON = "data:image/png;base64,";
	var PROPO_ICON = "data:image/png;base64,";
	var A_ICON = "data:image/png;base64,";
	var B_ICON = "data:image/png;base64,";

	function create_button(src_normal, src_pushed, callback) {
		var button = document.createElement("img");
		button.src = src_normal;
		button.src_normal = src_normal;
		button.src_pushed = src_pushed;
		button.down = false;
		button.set_src = function(src_normal, src_pushed) {
			button.src_normal = src_normal;
			button.src_pushed = src_pushed;
			button.src = (!button.down ? src_normal : src_pushed);
		}

		var sx = 0, sy = 0;
		var x_axis = 0;// -1:1
		var x_axis_candidate = null;
		var y_axis = 0;// -1:1
		var y_axis_candidate = null;
		var mousedownFunc = function(ev) {
			if (callback) {
				callback({
					type : "down"
				});
			}

			if (ev.type == "touchstart") {
				ev.clientX = ev.pageX;
				ev.clientY = ev.pageY;
			}
			sx = ev.clientX;
			sy = ev.clientY;
			x_axis = 0;
			y_axis = 0;

			button.down = true;
			if (button.src_pushed) {
				button.src = button.src_pushed;
			}
		}
		button.mouseupFunc = function() {
			if (callback) {
				callback({
					type : "up"
				});
			}

			button.down = false;
			button.src = button.src_normal;

			x_axis_candidate = 0;
			y_axis_candidate = 0;
		}
		button.mousemoveFunc = function(ev) {
			if (ev.type == "touchmove") {
				ev.clientX = ev.pageX;
				ev.clientY = ev.pageY;
				ev.button = 0;
			}
			if (!button.down || ev.button != 0) {
				return;
			}
			var dx = (ev.clientX - sx);
			var dy = (ev.clientY - sy);

			var threshold = 1;
			dx = parseInt(dx / threshold) * threshold;
			dy = parseInt(dy / threshold) * threshold;
			sx += dx;
			sy += dy;

			var limit = window.parent.screen.width / 20;
			if (dx == 0) {
				// do nothing
			} else {
				x_axis += dx / limit;
				x_axis = Math.max(-1, Math.min(x_axis, 1));
				if (x_axis_candidate != x_axis) {
					x_axis_candidate = x_axis;
				}
			}
			if (dy == 0) {
				// do nothing
			} else {
				y_axis -= dy / limit;// minus means system coodinate to
				y_axis = Math.max(-1, Math.min(y_axis, 1));
				if (y_axis_candidate != y_axis) {
					y_axis_candidate = y_axis;
				}
			}
			ev.preventDefault();
			ev.stopPropagation();
		}
		var preventFunc = function(ev) {
			ev.preventDefault();
			ev.stopPropagation();
		}
		button.addEventListener("touchstart", mousedownFunc);
		button.addEventListener("mousedown", mousedownFunc);
		button.addEventListener("dragstart", preventFunc, {
			passive : false
		});

		setInterval(function() {
			var updated = false;
			var ev = {
				type : "axis",
				x : x_axis,
				y : y_axis
			};
			if (x_axis_candidate) {
				x_axis = x_axis_candidate;
				x_axis_candidate = null;
				ev.x = x_axis;
				updated = true;
			}
			if (y_axis_candidate) {
				y_axis = y_axis_candidate;
				y_axis_candidate = null;
				ev.y = y_axis;
				updated = true;
			}
			if (updated && callback) {
				callback(ev);
			}
		}, 200);

		button.style.position = 'absolute';
		button.style.display = "none";
		button.width = 50;
		button.height = 50;

		return button;
	}

	function init(plugin) {
		console.log(plugin.name + "::init()");
		
		m_a_button = create_button(A_ICON, A_ICON, function(e) {
			console.log("A:" + JSON.stringify(e));
		});
		m_a_button
			.setAttribute("style", "position:absolute; bottom:150px; left:10%;");

		m_b_button = create_button(B_ICON, B_ICON, function(e) {
			console.log("B:" + JSON.stringify(e));
		});
		m_b_button
			.setAttribute("style", "position:absolute; bottom:150px; right:10%;");

		m_left_axis_button = create_button(FORWARD_ICON, FORWARD_PUSHED_ICON, function(
			e) {
			console.log("LEFT_AXIS:" + JSON.stringify(e));
		});
		m_left_axis_button
			.setAttribute("style", "position:absolute; bottom:50px; left:10%;");

		m_right_axis_button = create_button(FORWARD_ICON, FORWARD_PUSHED_ICON, function(
			e) {
			console.log("RIGHT_AXIS:" + JSON.stringify(e));
		});
		m_right_axis_button
			.setAttribute("style", "position:absolute; bottom:50px; right:10%;");

		// addEventListener spec migration
		var supportsPassive = false;
		try {
			var opts = Object.defineProperty({}, 'passive', {
				get : function() {
					supportsPassive = true;
				}
			});
			window.addEventListener("test", null, opts);
		} catch (e) {
		}
		var mouseupFunc = function(ev) {
			if (m_left_axis_button.down) {
				m_left_axis_button.mouseupFunc(ev);
			}
			if (m_right_axis_button.down) {
				m_right_axis_button.mouseupFunc(ev);
			}
		}
		var mousemoveFunc = function(ev) {
			if (m_left_axis_button.down) {
				m_left_axis_button.mousemoveFunc(ev);
			}
			if (m_right_axis_button.down) {
				m_right_axis_button.mousemoveFunc(ev);
			}
		}
		document.addEventListener("touchend", mouseupFunc);
		document.addEventListener("mouseup", mouseupFunc);
		document.addEventListener("touchmove", mousemoveFunc, supportsPassive
			? {
				passive : false,
				capture : true
			}
			: true);
		document.addEventListener("mousemove", mousemoveFunc, supportsPassive
			? {
				passive : false,
				capture : true
			}
			: true);

		document.body.appendChild(m_a_button);
		document.body.appendChild(m_b_button);
		document.body.appendChild(m_left_axis_button);
		document.body.appendChild(m_right_axis_button);

		m_plugin_host.add_watch(SERVICE_DOMAIN + "status", function(ret) {
			m_status = JSON.parse(ret);
		});
	}
	return function(plugin_host) {
		m_plugin_host = plugin_host;
		var plugin = {
			name : "juki_agent",
			init_options : function(options) {
				if (!m_is_init) {
					m_is_init = true;
					init(plugin);
				}
			},
			event_handler : function(sender, event) {
				var params = event.split(" ");
				switch (params[0]) {
					case "SET_LEFT_VERTICAL_AXIS" :
						break;
					case "SET_LEFT_HORIZONTAL_AXIS" :
						break;
				}
			}
		};
		return plugin;
	}
})();